import "./TopTitle.css";

import { useTranslation } from "react-i18next";
export default function TopAbout() {
  const { t } = useTranslation();
  return (
    <div className="TopTitle">
      <h1 className="text-title"> {t("nav.3")}</h1>
    </div>
  );
}
